programme.desc:
Retired Army Segeant Gary Herber joins the Guyz for a day of inshore fishing around Key Largo. Gary shares his story of traumatic brain injury and an unsuccessful suicide attempt that led him to the Shepherd's Men organization. With this second chance at life, Gary dedicates his time to helping disabled veterans and fights against veteran suicide. George and Lain introduce Gary to fishing legend, Stu Apte, while touring the Florida Keys History and Discovery Museum in Islamorada. Chef John prepares an amazing grilled grouper with summer salad.

Watch more of The Fish Guyz here: https://www.carbontv.com/shows/the-fish-guyz/

