George and Lain fish with Captain Brandon Jimenez off the coast of Marathon. After catching a few Black Groupers, the Guyz bump troll for Wahoo. A toothy Barracuda and a Sailfish round out their day on the water. The Guyz visit Key's Fisheries in Marathon. Chef Cat prepares a delicious Everything Bagel Tuna.

